const MOD: u64 = 1000000000 + 7;

fn number_of_arrays(s: String, k: i32) -> i32 {
    let sv = s.as_bytes();
    let n = s.len();
    let mut dp = vec![0u64; n];
    for i in 0..n {
        let mut digit = 0;
        let mut sum = 0;
        for j in (0..=i).rev() {
            digit += (sv[j] - '0' as u8) as u64 * 10u64.pow((i-j) as u32);
            if digit > k as u64 || 10u64.pow((i-j) as u32) > k as u64{ break; }
            if digit == 0 || sv[j] - '0' as u8 == 0 { continue; }
            if j == 0 { sum = (sum + 1) % MOD;}
            else { sum = (sum + dp[j-1]) % MOD; }
        }
        dp[i] = sum;
    }
    (dp[n-1] % MOD) as i32
}

